// SPDX-License-Identifier: MIT
pragma solidity ^0.6.0;
pragma experimental ABIEncoderV2;

import '@openzeppelin/contracts-upgradeable/proxy/Initializable.sol';
import '@openzeppelin/contracts-upgradeable/access/AccessControlUpgradeable.sol';
import '@openzeppelin/contracts-upgradeable/utils/PausableUpgradeable.sol';
import '@openzeppelin/contracts/math/SafeMath.sol';
import 'abdk-libraries-solidity/ABDKMath64x64.sol';
import '@openzeppelin/contracts-upgradeable/token/ERC20/IERC20Upgradeable.sol';
import '@openzeppelin/contracts-upgradeable/token/ERC20/SafeERC20Upgradeable.sol';
import './interfaces/IRandoms.sol';
import './interfaces/IPriceOracle.sol';
import './characters.sol';
import './weapons.sol';
import './Crafting.sol';
import './util.sol';
import './interfaces/ICharacter.sol';
import './interfaces/ICipherCore.sol';
import './interfaces/IGameMaster.sol';
import './interfaces/ICrafting.sol';
import './RewardsManager/interfaces/IRewardsManager.sol';

contract GameMaster is Initializable, AccessControlUpgradeable, PausableUpgradeable, ICharacter, IGameMaster {
    using ABDKMath64x64 for int128;
    using SafeMath for uint256;
    using SafeMath for uint64;
    using SafeMath for uint24;
    using SafeMath for uint8;
    using SafeERC20Upgradeable for IERC20Upgradeable;

    bytes32 public constant GAME_ADMIN = keccak256('GAME_ADMIN');

    Characters public override characters;
    Weapons public override weapons;
    IERC20Upgradeable public override tagToken;
    IRandoms public randoms;

    function initialize(
        IERC20Upgradeable _tagToken,
        Characters _characters,
        Weapons _weapons,
        IRandoms _randoms
    ) public initializer {
        __AccessControl_init();

        _setupRole(DEFAULT_ADMIN_ROLE, msg.sender);
        _setupRole(GAME_ADMIN, msg.sender);

        tagToken = _tagToken;
        characters = _characters;
        weapons = _weapons;
        randoms = _randoms;

        fightXpGain = 32;
        staminaCostFight = 40;
        durabilityCostFight = 40;
    }

    uint8 staminaCostFight;
    uint8 durabilityCostFight;
    uint256 public fightXpGain; // multiplied based on power differences

    mapping(address => uint256) public tokenRewards; // user adress : tags wei
    mapping(uint256 => uint256) xpRewards; // character id : xp

    mapping(address => uint256) lastBlockNumberCalled;

    event FightOutcome(
        address indexed owner,
        uint256 indexed character,
        uint256 weapon,
        uint32 targetPower,
        uint8 targetTrait,
        uint24 playerRoll,
        uint24 enemyRoll,
        uint16 xpGain,
        uint256 tagsGain
    );
    event ShotOutcome(uint8 indexed player, uint256 totalDamage, uint8 bodyPartHit);

    uint16 combatDuration;
    uint8 constant FIGHTS_PER_ELITE_PER_DAY = 7;

    event MintWeaponsSuccess(address indexed minter, uint32 count);
    event MintWeaponsFailure(address indexed minter, uint32 count);

    event OverflowRewardWon(address indexed player, uint256 reward);
    event TagsHarvested(uint256 amount);

    event ParameterAdjusted(bytes32 indexed param, uint256 prevValue, uint256 newValue);

    ICipherCore public cipherCore;
    uint256 public totalEpochRewards;
    uint256 public nextEpochStartTimestamp;
    uint256 public epochDuration;
    uint256 public overflowReward;
    uint256 public chanceOfWinningOverflow;
    int128 public treasuryTax;
    address public treasury;
    uint256 public totalPlayerRewards;
    uint256 public fightRewardBaseAmount;
    int128 public burnPercentage;
    uint256 public injectedRewards;
    uint256 public overflowThreshold;
    uint256 public eliteFee;
    uint256 public traineeFee;
    uint256 public totalEliteToBeMinted;
    uint256 public totalTraineeToBeMinted;
    uint256 public overflowTax;
    uint256 public totalEliteMinted;
    uint256 public totalTraineeMinted;
    ICrafting public crafting;
    IRewardsManager public cipherChef;

    function mintCharacter(CharacterType ctype)
        public
        whenNotPaused
        // onlyNonContract
        oncePerBlock(msg.sender)
    {
        require(ctype == CharacterType.Elite || ctype == CharacterType.Trainee, 'Invalid class type');
        uint256 seed = randoms.getRandomSeed(msg.sender);
        uint256 taxAmount = 0;

        if (ctype == CharacterType.Elite) {
            require(totalEliteMinted <= totalEliteToBeMinted, 'No more elites left to mint');
            require(tagToken.allowance(msg.sender, address(this)) >= eliteFee, 'Not enough allowance');

            if (treasuryTax > 0) {
                taxAmount = ABDKMath64x64.mulu(treasuryTax, eliteFee);
                tagToken.safeTransferFrom(msg.sender, treasury, taxAmount);
            }
            tagToken.safeTransferFrom(msg.sender, address(this), eliteFee.sub(taxAmount));

            // all operators have a parent eliteId, for elites it will be between 1-10
            // totalEliteMinted.div(100).add(1) calculates the same for elites
            uint256 parentEliteId = totalEliteMinted.div(100).add(1);
            totalEliteMinted = totalEliteMinted.add(1);
            characters.mint(msg.sender, seed, CharacterType.Elite, parentEliteId);
        }
        if (ctype == CharacterType.Trainee) {
            require(totalTraineeMinted <= totalTraineeToBeMinted, 'No more trainees left to mint');
            require(tagToken.allowance(msg.sender, address(this)) >= traineeFee, 'Not enough allowance');

            if (treasuryTax > 0) {
                taxAmount = ABDKMath64x64.mulu(treasuryTax, traineeFee);
                tagToken.safeTransferFrom(msg.sender, treasury, taxAmount);
            }
            tagToken.safeTransferFrom(msg.sender, address(this), traineeFee.sub(taxAmount));

            // all operators have a parent eliteId, consequetive 5 trainees will have the same parent elite
            // totalTraineeMinted.div(5) calculates the same for trainees
            uint256 parentEliteId = totalTraineeMinted.div(5);
            totalTraineeMinted = totalTraineeMinted.add(1);
            characters.mint(msg.sender, seed, CharacterType.Trainee, parentEliteId);
        }
    }

    function getTargets(uint256 char, uint256 wep) public view returns (Target[4] memory) {
        (uint16 wepPower, , , , , , , ) = weapons.get(wep);

        return
            getTargetsInternal(
                getPlayerPower(characters.getPower(char), wepPower),
                weapons.getFireRate(wep),
                characters.getStaminaTimestamp(char),
                now.div(1 hours)
            );
    }

    function getTargetsInternal(
        uint24 playerPower,
        uint16 fireRate,
        uint64 staminaTimestamp,
        uint256 currentHour
    ) private pure returns (Target[4] memory) {
        // 4 targets, roll powers based on character + weapon power
        // targets expire on the hour

        uint256 baseSeed = RandomUtil.combineSeeds(RandomUtil.combineSeeds(staminaTimestamp, currentHour), playerPower);

        Target[4] memory targets;
        for (uint256 i = 0; i < targets.length; i++) {
            // we alter seed per-index or they would be all the same
            uint256 indexSeed = RandomUtil.combineSeeds(baseSeed, i);

            targets[i] = Target(
                uint24(RandomUtil.plusMinus10PercentSeeded(playerPower, indexSeed)),
                uint8(indexSeed % 4),
                fireRate // make this same as player fire rate
            );
        }

        return targets;
    }

    // 40 bits -- 24 bits power 8 bits trait 8 bits fireRate

    // Fighting Methods

    function unpackFightData(uint112 playerData)
        public
        pure
        returns (
            uint8 charTrait,
            uint8 charAccuracy,
            uint8 charClass,
            uint24 basePowerLevel,
            uint64 timestamp
        )
    {
        charTrait = uint8(playerData & 0xFF);
        charAccuracy = uint8((playerData >> 8) & 0xFF);
        charClass = uint8((playerData >> 16) & 0xFF);
        basePowerLevel = uint24((playerData >> 24) & 0xFFFFFF);
        timestamp = uint64((playerData >> 48) & 0xFFFFFFFFFFFFFFFF);
    }

    function fight(
        uint256 char,
        uint256 wep,
        Target calldata target,
        uint8 fightMultiplier
    ) external override whenNotPaused fightModifierChecks(char, wep) {
        require(fightMultiplier >= 1 && fightMultiplier <= 5);
        uint64 charStamina = characters.getStaminaTimestamp(char);

        (
            ,
            uint8 charAccuracy, // uint64 timestamp
            ,
            ,

        ) = unpackFightData(characters.getFightDataAndDrainStamina(char, uint8(fightMultiplier.mul(staminaCostFight))));
        uint24 charPower = characters.getPower(char);
        (uint16 wepPower, uint16 fireRate, , , , , , ) = weapons.get(wep);

        weapons.getFightDataAndDrainDurability(wep, uint8(fightMultiplier.mul(durabilityCostFight)));

        _verifyFight(charPower, wepPower, charStamina, fireRate, target);

        performFight(
                char,
                wep,
                getPlayerPower(charPower, wepPower),
                uint24(target.power),
                uint8(target.trait),
                charAccuracy,
                fightMultiplier
        );
    }

    function _verifyFight(
        uint24 basePowerLevel,
        uint24 weaponPower,
        uint64 timestamp,
        uint16 fireRate,
        Target memory target
    ) internal view {
        verifyFight(basePowerLevel, weaponPower, timestamp, fireRate, now.div(1 hours), target);
    }

    function verifyFight(
        uint24 playerBasePower,
        uint24 weaponPower,
        uint64 staminaTimestamp,
        uint16 fireRate,
        uint256 hour,
        Target memory target
    ) public pure {
        Target[4] memory targets = getTargetsInternal(
            getPlayerPower(playerBasePower, weaponPower),
            fireRate,
            staminaTimestamp,
            hour
        );
        bool foundMatch = false;
        for (uint256 i = 0; i < targets.length; i++) {
            if (
                targets[i].power == target.power &&
                targets[i].trait == target.trait &&
                targets[i].fireRate == target.fireRate
            ) {
                foundMatch = true;
                i = targets.length;
            }
        }

        require(foundMatch, 'Target invalid');
    }

    function performFight(
        uint256 char,
        uint256 wep,
        uint24 playerPower,
        uint24 targetPower,
        uint8 targetTrait,
        uint8 playerAccuracy,
        uint8 fightMultiplier
    ) private {
        uint256 seed = randoms.getRandomSeed(msg.sender);
        uint8 charTrait = characters.getElement(char);
        uint8 charClass = characters.getClass(char);

        playerPower = weapons.getFightData(wep, playerPower, charTrait, charClass);

        uint24 playerRoll = getPlayerPowerRoll(playerPower, playerAccuracy, wep, seed);

        if ((((targetTrait + 1) % 4) == charTrait)) {
            playerRoll = uint24(playerRoll.add(uint24(ABDKMath64x64.divu(7, 100).mulu(playerRoll))));
        }

        uint24 monsterRoll = getMonsterPowerRoll(targetPower, playerAccuracy, wep, RandomUtil.combineSeeds(seed, 1));

        if ((((charTrait + 1) % 4) == targetTrait)) {
            monsterRoll = uint24(monsterRoll.add(uint24(ABDKMath64x64.divu(7, 100).mulu(monsterRoll))));
        }

        uint16 xpRewardsToClaim = 0;
        uint256 tokens = 0;

        // iff player beats the monster
        if (playerRoll > monsterRoll) {
            xpRewardsToClaim = uint16(fightMultiplier.mul(getXpGainForFight(playerPower, targetPower)));
            tokens = fightMultiplier.mul(getTokenGainForFight(targetPower));

            // decrease reward if we are runing out of totalEpochRewards
            if (totalEpochRewards < tokens) {
                tokens = totalEpochRewards;
            }

            totalEpochRewards = totalEpochRewards.sub(tokens);

            // Player won overflow reward
            tokens = handleOverflow(char,seed,tokens);

            // stake tokens
            handleStake(tokens);

            // Reward player with loot items -- for elites and trainees both
            lootItems(char, tokens);

            if (xpRewardsToClaim > 65535) {
                xpRewardsToClaim = 65535;
            }
            if (xpRewardsToClaim > 0) {
                characters.gainXp(char, uint16(xpRewardsToClaim));
            }

        } else {
            handleStake(tokens);
        }

            emit FightOutcome(
                msg.sender,
                char,
                wep,
                targetPower,
                targetTrait,
                playerRoll,
                monsterRoll,
                xpRewardsToClaim,
                tokens
            );
    }

    function handleStake(uint256 tokens) private {

        if (tokenRewards[msg.sender] > 0) {
            tokens = tokens.add(tokenRewards[msg.sender]);
            tokenRewards[msg.sender] = 0;
        }

        if(tokens > 0) {
            // approve tokens to chef contract
            tagToken.safeApprove(address(cipherChef), tokens);
            // deposit to chef contract on behalf of users
            cipherChef.deposit(0, tokens, msg.sender);
        }
    }

    function handleOverflow(uint256 char, uint256 seed, uint256 tokens) private returns(uint256) {
        CharacterType cType = characters.getCharacterType(char);
        uint256 overflowWon;
        if (overflowReward > 0 && RandomUtil.combineSeeds(seed, block.timestamp).mod(chanceOfWinningOverflow) == 0) {

                if (cType == CharacterType.Trainee) {
                    // Trainees get extra loot items when they win overflow
                    lootItems(char,tokens);
                    overflowWon = 0;
                    tokens = 0;
                } else {
                    overflowWon = overflowReward > overflowThreshold ? overflowThreshold : overflowReward;
                    overflowReward = overflowReward.sub(overflowWon);

                    uint256 overflowTaxIncrement = ABDKMath64x64.mulu(treasuryTax, overflowWon);
                    overflowWon = overflowWon.sub(overflowTaxIncrement);
                    overflowTax = overflowTax.add(overflowTaxIncrement);

                    tokens = tokens.add(overflowWon);
                }

                emit OverflowRewardWon(msg.sender, overflowWon);
        }

        return tokens;
    }

    function lootItems(uint256 char, uint256 tokens) private {
        crafting.lootItems(char, (tokens / 1 ether), msg.sender);
    }

    function getPlayerPowerRoll(
        uint24 playerFightPower,
        uint8 playerAccuracy,
        uint256 wep,
        uint256 seed
    ) internal returns (uint24) {
        (, uint16 _fireRate, uint8 _accuracy, , , , , ) = weapons.get(wep);

        uint8 finalAccuracy = uint8(ABDKMath64x64.divu(_accuracy, 100).mulu(playerAccuracy));
        uint256 shotsFired = uint256(ABDKMath64x64.divu(_fireRate, 100).mulu(combatDuration)); // floor value
        uint256 totalDamage = 0;
        for (uint256 i = 0; i < shotsFired; i++) {
            uint256 indexSeed = RandomUtil.combineSeeds(seed, i);
            uint8 bodyPartHit = calculateBodyPartHit(finalAccuracy, indexSeed);
            uint24 perShotDamage = calculateBodyPartShot(playerFightPower, bodyPartHit);
            totalDamage = totalDamage.add(perShotDamage);
            emit ShotOutcome(0, perShotDamage, bodyPartHit);
        }

        return uint24(totalDamage);
    }

    function getMonsterPowerRoll(
        uint24 monsterFightPower,
        uint8 monsterAccuracy,
        uint256 wep,
        uint256 seed
    ) internal returns (uint24) {
        (, uint16 _fireRate, uint8 _accuracy, , , , , ) = weapons.get(wep);

        uint8 finalAccuracy = uint8(ABDKMath64x64.divu(_accuracy, 100).mulu(monsterAccuracy));
        finalAccuracy = uint8(RandomUtil.plusMinus10PercentSeeded(finalAccuracy, seed));
        uint256 shotsFired = uint256(ABDKMath64x64.divu(_fireRate, 100).mulu(combatDuration)); // floor value

        uint256 totalDamage = 0;
        for (uint256 i = 0; i < shotsFired; i++) {
            uint256 indexSeed = RandomUtil.combineSeeds(seed, i);
            uint8 bodyPartHit = calculateBodyPartHit(finalAccuracy, indexSeed);
            uint24 perShotDamage = calculateBodyPartShot(monsterFightPower, bodyPartHit);
            totalDamage = totalDamage.add(perShotDamage);
            emit ShotOutcome(1, perShotDamage, bodyPartHit);
        }

        return uint24(totalDamage);
    }

    function calculateBodyPartShot(uint24 power, uint8 bodyPart) internal pure returns (uint24) {
        // 0 -  (-12)% legs
        // 1 - (0%) body
        // 2 - (+12)% head

        if (bodyPart == 0) {
            power = uint24(power.sub(uint24((ABDKMath64x64.divu(12, 100)).mulu(power))));
        } else if (bodyPart == 1) {
            power = power;
        } else if (bodyPart == 2) {
            power = uint24(power.add(uint24((ABDKMath64x64.divu(12, 100)).mulu(power))));
        } else {
            power = 0;
        }
        return power;
    }

    function calculateBodyPartHit(uint8 accuracy, uint256 seed) internal pure returns (uint8) {
        uint256 base = 33;
        uint256 roll = seed % 100;
        if (accuracy == 0) {
            return uint8(RandomUtil.randomSeededMinMax(0, 2, seed));
        } else if (accuracy > 0 && accuracy <= base) {
            uint256 x1 = base.sub(accuracy);
            uint256 x2 = base.sub(accuracy).add(1);
            uint256 x3 = x2.add(base).add(accuracy.div(2));

            if (roll >= 0 && roll <= x1) {
                return 0;
            } else if (roll > x1 && roll <= x3) {
                return 1;
            } else if (roll > x3) {
                return 2;
            }
        } else if (accuracy > base && accuracy <= 82) {
            uint256 x1 = (base.add(base.div(2))).sub(accuracy.sub(base));

            if (roll >= 0 && roll <= x1) {
                return 1;
            } else {
                return 2;
            }
        } else if (accuracy > 82) {
            return 2;
        } else {
            return 0;
        }
    }

    function getXpGainForFight(uint24 playerPower, uint24 monsterPower) internal view returns (uint16) {
        return uint16(ABDKMath64x64.divu(monsterPower, playerPower).mulu(fightXpGain));
    }

    function getTokenGainForFight(uint24 monsterPower) internal view returns (uint256) {
        uint24 maxWeaponPower = 50000;
        uint24 minWeaponPower = 5000;
        uint24 maxMonsterPower = uint24(
            ABDKMath64x64.mulu(ABDKMath64x64.divu(11, 10), (characters.getPowerAtLevel(255).add(maxWeaponPower)))
        );
        uint24 minMonsterPower = uint24(
            ABDKMath64x64.mulu(ABDKMath64x64.divu(9, 10), (characters.getPowerAtLevel(0).add(minWeaponPower)))
        );
        int128 k = ABDKMath64x64.divu(monsterPower.sub(minMonsterPower), maxMonsterPower.sub(minMonsterPower));
        int128 one = ABDKMath64x64.divu(1, 1);
        int128 half = ABDKMath64x64.divu(1, 2);
        int128 m = ABDKMath64x64.mul(half, ABDKMath64x64.add(one, ABDKMath64x64.sqrt(k)));
        return ABDKMath64x64.mulu(m, fightRewardBaseAmount);
    }

    function claimTokenRewards() public override {
        uint256 _tokenRewards = tokenRewards[msg.sender];
        tokenRewards[msg.sender] = 0;
        totalPlayerRewards = totalPlayerRewards.sub(_tokenRewards);

        _payPlayerConverted(msg.sender, _tokenRewards);
    }

    function _payPlayerConverted(address playerAddress, uint256 convertedAmount) internal {
        tagToken.safeTransfer(playerAddress, convertedAmount);
    }

    function getMyCharacters() public view returns (uint256[] memory) {
        uint256[] memory tokens = new uint256[](characters.balanceOf(msg.sender));
        for (uint256 i = 0; i < tokens.length; i++) {
            tokens[i] = characters.tokenOfOwnerByIndex(msg.sender, i);
        }
        return tokens;
    }

    function getMyWeapons() public view returns (uint256[] memory) {
        uint256[] memory tokens = new uint256[](weapons.balanceOf(msg.sender));
        for (uint256 i = 0; i < tokens.length; i++) {
            tokens[i] = weapons.tokenOfOwnerByIndex(msg.sender, i);
        }
        return tokens;
    }

    // can be called by anyone
    function startNextEpoch() external {
        require(now > nextEpochStartTimestamp, 'New epoch cannot be started yet');
        nextEpochStartTimestamp = nextEpochStartTimestamp.add(epochDuration);

        if (nextEpochStartTimestamp < now) {
            nextEpochStartTimestamp = now.add(epochDuration);
        }

        // pay overflow tax
        if (overflowTax > 0) {
            tagToken.safeTransfer(treasury, overflowTax);
            overflowTax = 0;
        }

        uint256 excessBalance = getExcessBalance();
        if (excessBalance > 0) {
            // pay tax
            uint256 taxAmount = 0;
            if (treasuryTax > 0) {
                taxAmount = ABDKMath64x64.mulu(treasuryTax, excessBalance);
                tagToken.safeTransfer(treasury, taxAmount);
            }

            // burn tokens
            uint256 burnAmount = 0;
            if (burnPercentage > 0) {
                burnAmount = ABDKMath64x64.mulu(burnPercentage, excessBalance);
                tagToken.safeTransfer(address(0x1), burnAmount);
            }

            excessBalance = excessBalance.sub(taxAmount).sub(burnAmount);

            int128 oneThird = ABDKMath64x64.divu(1, 3);

            // deposit to Cipher Core
            uint256 depositAmount = ABDKMath64x64.mulu(oneThird, excessBalance);
            tagToken.approve(address(cipherCore), depositAmount);
            cipherCore.depositInTags(depositAmount);
            excessBalance = excessBalance.sub(depositAmount);

            // rollover to next epoch rewards
            totalEpochRewards = ABDKMath64x64.mulu(oneThird, excessBalance);
            excessBalance = excessBalance.sub(totalEpochRewards);

            // send unclaimed rewards to overflow
            overflowReward = overflowReward.add(excessBalance);
        }

        // pull rewards from Core
        uint256 balanceBefore = tagToken.balanceOf(address(this));
        cipherCore.harvestYieldInTags();
        uint256 harvested = tagToken.balanceOf(address(this)).sub(balanceBefore);
        totalEpochRewards = totalEpochRewards.add(harvested);
        emit TagsHarvested(harvested);

        // add injected rewards
        totalEpochRewards = totalEpochRewards.add(injectedRewards);
        injectedRewards = 0;

        // update reward formula multiplier
        fightRewardBaseAmount = _calculateFightRewardBaseline(totalEpochRewards);
    }

    function injectRewards(uint256 amount) external {
        require(tagToken.transferFrom(_msgSender(), address(this), amount), 'Unable to pull funds from the sender');

        injectedRewards = injectedRewards.add(amount);
    }

    function _calculateFightRewardBaseline(uint256 totalRewards) internal view returns (uint256) {
        uint256 epochDurationInDays = epochDuration.div(1 days);
        uint256 maxNumOfFights = (characters.getOperatorsCountPerRole(CharacterType.Elite))
            .mul(FIGHTS_PER_ELITE_PER_DAY)
            .mul(epochDurationInDays);
        uint256 result = totalRewards.div(uint256(maxNumOfFights));

        return result;
    }

    function setCombatDuration(uint16 duration) public restricted {
        emit ParameterAdjusted(keccak256('combatDuration'), combatDuration, duration);
        combatDuration = duration;
    }

    function setEpochDuration(uint256 duration) public restricted {
        emit ParameterAdjusted(keccak256('epochDuration'), epochDuration, duration);
        epochDuration = duration;
    }

    function setChanceOfWinningOverflow(uint256 chance) public restricted {
        emit ParameterAdjusted(keccak256('chanceOfWinningOverflow'), chanceOfWinningOverflow, chance);
        chanceOfWinningOverflow = chance;
    }

    function setTreasury(address _treasury) public restricted {
        treasury = _treasury;
    }

    function setTreasuryTax(int128 _tax) public restricted {
        emit ParameterAdjusted(keccak256('treasuryTax'), uint256(treasuryTax), uint256(_tax));
        treasuryTax = _tax;
    }

    function setBurnPercentage(int128 _burnPercentage) public restricted {
        emit ParameterAdjusted(keccak256('burnPercentage'), uint256(burnPercentage), uint256(_burnPercentage));
        burnPercentage = _burnPercentage;
    }

    function setOverflowThreshold(uint256 _overflowThreshold) public restricted {
        emit ParameterAdjusted(keccak256('overflowThreshold'), overflowThreshold, _overflowThreshold);
        overflowThreshold = _overflowThreshold;
    }

    function setFightXpGain(uint256 _fightXpGain) public restricted {
        emit ParameterAdjusted(keccak256('fightXpGain'), fightXpGain, _fightXpGain);
        fightXpGain = _fightXpGain;
    }

    function setFightRewardBaseAmount(uint256 _fightRewardBaseAmount) public restricted {
        emit ParameterAdjusted(keccak256('fightRewardBaseAmount'), fightRewardBaseAmount, _fightRewardBaseAmount);
        fightRewardBaseAmount = _fightRewardBaseAmount;
    }

    function setEliteFee(uint256 _fee) public restricted {
        emit ParameterAdjusted(keccak256('eliteFee'), eliteFee, _fee);
        eliteFee = _fee;
    }

    function setTraineeFee(uint256 _fee) public restricted {
        emit ParameterAdjusted(keccak256('traineeFee'), traineeFee, _fee);
        traineeFee = _fee;
    }

    function setTotalEliteToBeMinted(uint256 _value) public restricted {
        emit ParameterAdjusted(keccak256('totalEliteToBeMinted'), totalEliteToBeMinted, _value);
        totalEliteToBeMinted = _value;
    }

    function setTotalEliteMinted() public restricted {
        totalEliteMinted = characters.getOperatorsCountPerRole(CharacterType.Elite);
    }

    function setTotalTraineeToBeMinted(uint256 _value) public restricted {
        emit ParameterAdjusted(keccak256('totalTraineeToBeMinted'), totalTraineeToBeMinted, _value);
        totalTraineeToBeMinted = _value;
    }

    function setTotalTraineeMinted() public restricted {
        totalTraineeMinted = characters.getOperatorsCountPerRole(CharacterType.Trainee);
    }

    function setCore(ICipherCore _core) public restricted {
        cipherCore = _core;
    }

    function setCrafting(ICrafting _crafting) public restricted {
        crafting = _crafting;
    }

    function setTagToken(IERC20Upgradeable _tagToken) public restricted {
        tagToken = _tagToken;
    }

    function setRewardsManager(IRewardsManager _chef) public restricted {
        cipherChef = _chef;
    }

    function rewardsManager() public override returns (IRewardsManager) {
        return cipherChef;
    }

    function getPlayerPower(uint24 basePower, uint24 weaponPower) public pure returns (uint24) {
        return uint24(weaponPower.add(basePower));
    }

    function getExcessBalance() public view returns (uint256) {
        uint256 balance = tagToken.balanceOf(address(this));
        return balance.sub(overflowReward).sub(totalPlayerRewards).sub(injectedRewards).sub(overflowTax);
    }

    function isNotContract(address user) internal view returns (bool) {
        return tx.origin == user;
    }

    // modifier onlyNonContract() {
    //     _onlyNonContract();
    //     _;
    // }

    // function _onlyNonContract() internal view {
    //     require(tx.origin == msg.sender);
    // }

    modifier oncePerBlock(address user) {
        _oncePerBlock(user);
        _;
    }

    modifier restricted() {
        _restricted();
        _;
    }

    modifier isWeaponOwner(uint256 weapon) {
        _isWeaponOwner(weapon);
        _;
    }

    function _isWeaponOwner(uint256 weapon) internal view {
        require(weapons.ownerOf(weapon) == msg.sender, 'Not the weapon owner');
    }

    modifier isCharacterOwner(uint256 character) {
        _isCharacterOwner(character);
        _;
    }

    function _isCharacterOwner(uint256 character) internal view {
        require(characters.ownerOf(character) == msg.sender, 'Not the character owner');
    }

    modifier fightModifierChecks(uint256 character, uint256 weapon) {
        // _onlyNonContract();
        _isCharacterOwner(character);
        _isWeaponOwner(weapon);
        _;
    }

    function _restricted() internal view {
        require(hasRole(GAME_ADMIN, msg.sender), 'Game admin role needed.');
    }

    function _oncePerBlock(address user) internal {
        require(lastBlockNumberCalled[user] < block.number, 'OCB');
        lastBlockNumberCalled[user] = block.number;
    }

    modifier onlyOwner() {
        _onlyOwner();
        _;
    }

    function _onlyOwner() internal view {
        require(hasRole(DEFAULT_ADMIN_ROLE, msg.sender), 'Admin role needed.');
    }

    function pause() external onlyOwner {
        _pause();
    }

    function unpause() external onlyOwner {
        _unpause();
    }
}
